def removeComentario(str):
    r = ""
    afd = {0:{'/':1},
           1:{'/':2, '*':3},
           2:{'\n':0},
           3:{'*':4},
           4:{'/':0},
    }
    f = [0, 1]
    state = 0
    for c in str:
        try:
            state = afd[state][c] # OLHANDO NO ESTADO O SÍMBOLO DO ARQUIVO.
#            print ("estado", state)
        except KeyError:
            if state == 1: # ENCONTROU OUTRA BARRA /.
                r += '/' # ADD AO r A /
#                print ("minha string ",r, "\n")
                state = 0 # O ESTADO VOLTA A SER 0, VEJO O SE É ESTADO DE ACEITAÇÃO 
            if state in f: # SE ENCONTRO UM ESTADO DE ACEITAÇÃO, CONCATENO A LINHA QUE ESTOU
                r += c
    if state in f:    # TODA VEZ QUE CHEGAR NO ESTADO FINAL RETORNO A STRING r
        return r
    else:
        return None


